Sex #9
We know you're all wondering-what was life like in Saturn City in the glorious heyday of the Armored Saint? Find out this issue in a special flashback sequence drawn by MORGAN JESKE (CHANGE)! An orgy of action! Secrets revealed! Onions peeled! Don't miss it!

Sex #10
SEX goes global! Simon Cooke is stalked! Larry gets laid! Keenan seeds his future! Annabelle keeps it together! The Prank Addict is run down! Bring the noise! Bring the pain! Bring your money and buy more SEX!

Sex #11
This issue, SEX goes even deeper than ever before! Simon Cooke faces his adulthood. Japanese businessmen get their freak on. Annabelle reprimands an employee. Then there's the battle cry heard throughout the underworld: &quot;Breaks! Damn straight!&quot; This one's a rub for the ages!

